I’m back. For the last 16 days I’ve been cruising around the bottom of the world on a 140 passenger cruise ship seeing things that will  be imprinted on my mind for the rest of my life and I’m stoked to share with you what I saw and the adventure that we had. 
First off and one of the most impressive things I saw was this Tabular Iceberg. This photo doesn’t do it justice and no photo really can because it is actually 20 miles across and 8 miles wide. So what you are seeing here is just a sliver of it’s actually size AND this is one of the smaller massive tabular icebergs floating around the Southern Ocean. 
@chimuadventures

After the longest summer of life,  I have finally returned to winter and that for me now also means skis 🎿. Last year I learned how to ski with the focus on learning to backcountry ski. Many told me that it would be a long time before I’d be able to ski well enough to backcountry ski but I think that my prior snowboarding experience coupled with good physical fitness made the process quite easy. I say this not to brag but to simple say that  listening to others tell you want you can and can’t do is a waste of your time. Get out there and live life how YOU want to. 
Music: Purity Ring- Fineshrine
@spyderactive #spyderactive
